  \"2016-07-27T22:25:12.718645\",\n\t\"name\": \"pine-island-matlacha-pass-island-bay-and-caloosahatchee-national-wildlife-refuges-comprehe\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Pine Island, Matlacha Pass, Island Bay, and Caloosahatchee
  NWRs for the next 15 years. This plan outlines the refuges' vision and purpose and
  describes how Pine Island, Matlacha Pass, Island Bay, and Caloosahatchee NWRs will
  contribute to the overall mission of the Refuge System. The plan provides an introduction
  to the Refuge, an overview of the CCP process, information about plan development
  and the management direction, and strategies for implementation. Key planning issues
  include: wildlife management, habitat management, visitor services, and Refuge administration.\",\n\t\"license_title\":
